import React, { Component } from "react";
import styled from "styled-components";
// import { Button } from "../../Components";

const Button = styled.button`
  /* Adapt the colors based on primary prop */
  background: ${(props) => (props.primary ? "palevioletred" : "white")};
  color: ${(props) => (props.primary ? "white" : "palevioletred")};

  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
`;

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            flex: 1,
            maxWidth: "252px",
            maxHeight: "284px",
            padding: "32px",
            borderRadius: "10px",
            boxShadow: "5px 5px 15px rgba(0, 0, 0, 0.15)",
            justifyContent: "space-evenly",
            alignItems: "center",
          }}
        >
          <img src={require("../../assets/public.svg")} />
          <div style={{ margin: "5%" }}>Public Q&A</div>
          <div style={{ textAlign: "center" }}>
            Get answers to more than 16.5 million questions and give back by
            sharing your knowledge with others. Sign up for an account.
          </div>
          <Button primary>Browse Questions</Button>
        </div>
      </>
    );
  }
}

export default Card;
